import React from "react";


export default function MenuButton( {showMenu, setShowMenu}){
    function toggleMenu(){
       setShowMenu(!showMenu); 
    }

    return(
        <section id="menu-button" className="absolute">
            <div className="container inline-block " onClick={toggleMenu}>
                <div className="bar1 w-10 h-5 bg-main-black m-1"></div>
            </div>
        </section>
    );
}
